function [P_sq,K] = A_QR(R_sq,P_sq, gyro_valid,H)
%#codegen
[nr,~] = size(R_sq);
[np,~] = size(P_sq);

A_QR          = [R_sq',zeros(nr,np);(P_sq')*H', P_sq'];
[~,R]         = qr(A_QR);
P_sq          = R(7:12,7:12)'; % Updated P_sq
K_bar         = R(1:6,7:12)';
Innovation_sq = R(1:6,1:6)';

K = K_bar/Innovation_sq;

    if( gyro_valid == 0 )
        % this is done so that we do not update bias based
        % on false gyro readings
        K(4:6,:) = zeros(3,6); 
    end
end
